  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this study was to assess
  the regional economic implications associated with draft CCP management strategies
  for Rappahannock River Valley NWR. This report first presents a description of the
  local area and economic activities near Rappahannock River Valley National Wildlife
  Refuge. Next, the methods used to conduct an economic assessment are described.
  An analysis of current and proposed management strategies that could affect the
  local economy is then presented. The Refuge management activities of economic concern
  in this analysis are: Refuge purchases of goods and services within the local community;
  Refuge personnel salary spending; spending in the local area by Refuge visitors;
  and Refuge land purchases and changes in local tax revenue.\",\n\t\"license_title\":
